proxy-groups:
  - name: UDP
    type: select
    include-all-proxies: true
  - name: Rules
    type: select
    proxies:
      - UDP
      - DIRECT
      - REJECT
rules:
  - DOMAIN-SUFFIX,ir,DIRECT
  - DOMAIN-KEYWORD,iran,DIRECT
  - DOMAIN-SUFFIX,cn,DIRECT
  - IP-CIDR,192.168.0.0/16,DIRECT
  - DOMAIN-KEYWORD,google,Rules
  - DOMAIN-KEYWORD,telegram,Rules
  - MATCH,Rules
dns:
  enable: true
  listen: 0.0.0.0:53
  ipv6: true
  enhanced-mode: fake-ip
  fake-ip-range: 198.18.0.1/16
  use-system-hosts: true
  fake-ip-filter:
    - +.ir
    - +.ru
    - +.cn
    - +.google.com
    - +.telegram.org
  default-nameserver:
    - 178.22.100.100
    - 185.51.200.2
  nameserver:
    - 1.1.1.1
    - 8.8.8.8
  fallback:
    - 1.1.1.1
    - 8.8.8.8
  fallback-filter:
    geoip: true
    geoip-code: IR
    domain:
      - +.google.com
      - +.telegram.org
tun:
  enable: true
  stack: gvisor
  dns-hijack:
    - any:53
  auto-route: true
  auto-detect-interface: true
  strict-route: false
  mtu: 1500
sniffer:
  enable: true
  parse-pure-ip: false
  override-destination: true
  sniff:
    TLS:
      ports:
        - 443
        - 8443
    QUIC:
      ports:
        - 443
    HTTP:
      ports:
        - 80
        - 8080
      override-destination: true
